    const [notes, setNotes] = useState([
        {
            id:nanoid(),
        text:"this is my 1 note",
        date:"3/6/2022"
    },
        {
            id:nanoid(),
        text:"this is my 2 note",
        date:"5/6/2022"
    },
        {
            id:nanoid(),
        text:"this is my 3 note",
        date:"6/6/2022"
    },


])
  return (
    <div className='container' >
        <BlogList notes = {notes}/>
    </div>
  )
}
